(function EFB2Mod() {
    const $$scoped_efb_globals = {};

    function EFB2__defineExecCmdAsGlobal() {
        var getServer = ModAPI.reflect.getClassById("net.minecraft.server.MinecraftServer").staticMethods.getServer
            .method;
        globalThis.efb2__executeCommandAs = function efb2__executeCommandAs($commandsender, command, feedback) {
            var server = getServer();
            if (!server) {
                return;
            }
            var commandManager = server.$commandManager;

            //lie a bit
            var x = $commandsender.$canCommandSenderUseCommand;
            $commandsender.$canCommandSenderUseCommand = () => 1;

            var y = $commandsender.$sendCommandFeedback;
            $commandsender.$sendCommandFeedback = feedback ? () => 1 : () => 0;

            const notifyOps0 = ModAPI.hooks.methods.nmc_CommandBase_notifyOperators0;
            const notifyOps = ModAPI.hooks.methods.nmc_CommandBase_notifyOperators;
            const addChatMsg = $commandsender.$addChatMessage;

            if (!feedback) {
                ModAPI.hooks.methods.nmc_CommandBase_notifyOperators0 = () => {};
                ModAPI.hooks.methods.nmc_CommandBase_notifyOperators = () => {};
                $commandsender.$addChatMessage = () => {};
            }

            try {
                commandManager.$executeCommand($commandsender, ModAPI.util.str(command));
            } catch (error) {
                console.error(error);
            }

            if (!feedback) {
                ModAPI.hooks.methods.nmc_CommandBase_notifyOperators0 = notifyOps0;
                ModAPI.hooks.methods.nmc_CommandBase_notifyOperators = notifyOps;
                $commandsender.$addChatMessage = addChatMsg;
            }

            $commandsender.$canCommandSenderUseCommand = x;
            $commandsender.$sendCommandFeedback = y;
        };
    }
    ModAPI.dedicatedServer.appendCode(EFB2__defineExecCmdAsGlobal);
    EFB2__defineExecCmdAsGlobal();
    function fixupBlockIds() {
        var blockRegistry = ModAPI.util
            .wrap(ModAPI.reflect.getClassById("net.minecraft.block.Block").staticVariables.blockRegistry)
            .getCorrective();
        var BLOCK_STATE_IDS = ModAPI.util
            .wrap(ModAPI.reflect.getClassById("net.minecraft.block.Block").staticVariables.BLOCK_STATE_IDS)
            .getCorrective();
        blockRegistry.registryObjects.hashTableKToV.forEach((entry) => {
            if (entry) {
                var block = entry.value;
                var validStates = block.getBlockState().getValidStates();
                var stateArray = validStates.array || [validStates.element];
                stateArray.forEach((iblockstate) => {
                    var i =
                        (blockRegistry.getIDForObject(block.getRef()) << 4) |
                        block.getMetaFromState(iblockstate.getRef());
                    BLOCK_STATE_IDS.put(iblockstate.getRef(), i);
                });
            }
        });
    }

    (function Metadata() {
        const img =
            "data:image/png;base64,";
        ModAPI.meta.title("JeffsAwesomeSauceMod");
        ModAPI.meta.version("v0.02.1");
        ModAPI.meta.icon(img);
        ModAPI.meta.description("Requires AsyncSink. Adds cool funny stuff!");
        ModAPI.meta.credits("By JaecadeJnight");
    })();
    // Made by JaecadeJnight
    (() => {
        const pissBucketTexture =
            "data:image/png;base64,";
        const cheeseburgerTexture =
            "data:image/png;base64,";

        function PissBucketItem() {
            var creativeMiscTab = ModAPI.reflect.getClassById("net.minecraft.creativetab.CreativeTabs").staticVariables
                .tabMisc;
            var itemClass = ModAPI.reflect.getClassById("net.minecraft.item.Item");
            var itemSuper = ModAPI.reflect.getSuper(itemClass, (x) => x.length === 1);
            function nmi_ItemPissBucket() {
                itemSuper(this);
                // Use super function to get block properties on this class.
                this.$setCreativeTab(creativeMiscTab);
            }
            ModAPI.reflect.prototypeStack(itemClass, nmi_ItemPissBucket);
            nmi_ItemPissBucket.prototype.$onItemRightClick = function ($itemstack, $world, $player) {
                // example of how to override a method
                return $itemstack;
            };
            async function addRecipe(itemm) {
                var ObjectClass = ModAPI.reflect.getClassById("java.lang.Object").class;
                function ToChar(char) {
                    return ModAPI.reflect
                        .getClassById("java.lang.Character")
                        .staticMethods.valueOf.method(char[0].charCodeAt(0));
                }
                // Define the recipe legend to map characters to items
                var recipeLegend = {
                    I: { type: "item", id: "gold_ingot" },
                    Q: { type: "item", id: "bucket" }
                };
                // Define the crafting grid pattern for the recipe
                var recipePattern = [" I ", " Q "];
                // Convert the recipe pattern and legend into the required format
                var recipeInternal = [];
                Object.keys(recipeLegend).forEach((key) => {
                    recipeInternal.push(ToChar(key));
                    var ingredient = (recipeLegend[key].type === "block" ? ModAPI.blocks : ModAPI.items)[
                        recipeLegend[key].id
                    ].getRef();
                    recipeInternal.push(ingredient);
                });
                var recipeContents = recipePattern.flatMap((row) => ModAPI.util.str(row));
                var recipe = ModAPI.util.makeArray(ObjectClass, recipeContents.concat(recipeInternal));
                var resultItem = ModAPI.reflect.getClassById("net.minecraft.item.ItemStack").constructors[4](itemm, 1);
                // Register the recipe with CraftingManager
                var craftingManager = ModAPI.reflect
                    .getClassById("net.minecraft.item.crafting.CraftingManager")
                    .staticMethods.getInstance.method();
                ModAPI.hooks.methods.nmic_CraftingManager_addRecipe(craftingManager, resultItem, recipe);
            }
            function internal_reg() {
                var pissBucket_item = new nmi_ItemPissBucket().$setUnlocalizedName(ModAPI.util.str("pissbucket"));
                itemClass.staticMethods.registerItem.method(
                    ModAPI.keygen.item("pissbucket"),
                    ModAPI.util.str("pissbucket"),
                    pissBucket_item
                );
                ModAPI.items["pissbucket"] = pissBucket_item;
                addRecipe(pissBucket_item);
                return pissBucket_item;
            }
            if (ModAPI.items) {
                return internal_reg();
            } else {
                ModAPI.addEventListener("bootstrap", internal_reg);
            }
        }
        function CheeseburgerItem() {
            var creativeFoodTab = ModAPI.reflect.getClassById("net.minecraft.creativetab.CreativeTabs").staticVariables
                .tabFood;
            var itemClass = ModAPI.reflect.getClassById("net.minecraft.item.Item");
            var itemSuper = ModAPI.reflect.getSuper(itemClass, (x) => x.length === 1);
            var itemGetAttributes =
                ModAPI.reflect.getClassById("net.minecraft.item.Item").methods.getItemAttributeModifiers.method;
            function nmi_ItemCheeseburger() {
                itemSuper(this);
                // Use super function to get block properties on this class.
                this.$setCreativeTab(creativeFoodTab);
            }
            ModAPI.reflect.prototypeStack(itemClass, nmi_ItemCheeseburger);
            nmi_ItemCheeseburger.prototype.$onItemRightClick = function ($itemstack, $world, $player) {
                // example of how to override a method
                $player.$setItemInUse($itemstack, 32);
                return $itemstack;
            };
            nmi_ItemCheeseburger.prototype.$getItemUseAction = function () {
                return ModAPI.reflect.getClassById("net.minecraft.item.EnumAction").staticVariables["EAT"];
            };
            nmi_ItemCheeseburger.prototype.$getMaxItemUseDuration = function () {
                return 32;
            };
            nmi_ItemCheeseburger.prototype.$onItemUse0 = function ($itemstack, $player, $world, $blockpos) {
                return 0;
            };
            nmi_ItemCheeseburger.prototype.$onCreated = function ($itemstack, $world, $player) {};
            nmi_ItemCheeseburger.prototype.$onBlockDestroyed = function (
                $itemstack,
                $world,
                $block,
                $blockpos,
                $entity
            ) {
                return 0;
            };
            nmi_ItemCheeseburger.prototype.$onUpdate = function ($itemstack, $world, $player, $hotbar_slot, $is_held) {
                $is_held = $is_held ? true : false;
                return $itemstack;
            };
            nmi_ItemCheeseburger.prototype.$getItemAttributeModifiers = function () {
                var attributemap = itemGetAttributes.apply(this, []);
                return attributemap;
            };
            nmi_ItemCheeseburger.prototype.$getStrVsBlock = function ($itemstack, $block) {
                return 1.0;
            };

            async function addRecipe(itemm) {
                var ObjectClass = ModAPI.reflect.getClassById("java.lang.Object").class;
                function ToChar(char) {
                    return ModAPI.reflect
                        .getClassById("java.lang.Character")
                        .staticMethods.valueOf.method(char[0].charCodeAt(0));
                }
                // Define the recipe legend to map characters to items
                var recipeLegend = {
                    I: { type: "item", id: "bread" },
                    Q: { type: "item", id: "cooked_beef" }
                };
                // Define the crafting grid pattern for the recipe
                var recipePattern = [" I ", " Q ", " I "];
                // Convert the recipe pattern and legend into the required format
                var recipeInternal = [];
                Object.keys(recipeLegend).forEach((key) => {
                    recipeInternal.push(ToChar(key));
                    var ingredient = (recipeLegend[key].type === "block" ? ModAPI.blocks : ModAPI.items)[
                        recipeLegend[key].id
                    ].getRef();
                    recipeInternal.push(ingredient);
                });
                var recipeContents = recipePattern.flatMap((row) => ModAPI.util.str(row));
                var recipe = ModAPI.util.makeArray(ObjectClass, recipeContents.concat(recipeInternal));
                var resultItem = ModAPI.reflect.getClassById("net.minecraft.item.ItemStack").constructors[4](itemm, 1);
                // Register the recipe with CraftingManager
                var craftingManager = ModAPI.reflect
                    .getClassById("net.minecraft.item.crafting.CraftingManager")
                    .staticMethods.getInstance.method();
                ModAPI.hooks.methods.nmic_CraftingManager_addRecipe(craftingManager, resultItem, recipe);
            }
            function internal_reg() {
                var cheeseburger_item = new nmi_ItemCheeseburger().$setUnlocalizedName(ModAPI.util.str("cheeseburger"));
                itemClass.staticMethods.registerItem.method(
                    ModAPI.keygen.item("cheeseburger"),
                    ModAPI.util.str("cheeseburger"),
                    cheeseburger_item
                );
                ModAPI.items["cheeseburger"] = cheeseburger_item;
                addRecipe(cheeseburger_item);
                return cheeseburger_item;
            }
            if (ModAPI.items) {
                return internal_reg();
            } else {
                ModAPI.addEventListener("bootstrap", internal_reg);
            }
        }

        ModAPI.dedicatedServer.appendCode(PissBucketItem);
        ModAPI.dedicatedServer.appendCode(CheeseburgerItem);

        var pissBucket_item = PissBucketItem();
        var cheeseburger_item = CheeseburgerItem();

        ModAPI.addEventListener("lib:asyncsink", async () => {
            ModAPI.addEventListener("lib:asyncsink:registeritems", (renderItem) => {
                // items
                renderItem.registerItem(pissBucket_item, ModAPI.util.str("pissbucket"));
                renderItem.registerItem(cheeseburger_item, ModAPI.util.str("cheeseburger"));
            });
            //items
            AsyncSink.L10N.set("item.pissbucket.name", "Piss Bucket");
            AsyncSink.L10N.set("item.cheeseburger.name", "Cheeseburger");



            AsyncSink.setFile(
                "resourcepacks/AsyncSinkLib/assets/minecraft/models/item/pissbucket.json",
                JSON.stringify({
                    parent: "builtin/generated",
                    textures: { layer0: "items/pissbucket" },
                    display: {
                        thirdperson: { rotation: [-90, 0, 0], translation: [0, 1, -3], scale: [0.55, 0.55, 0.55] },
                        firstperson: { rotation: [0, -135, 25], translation: [0, 4, 2], scale: [1.7, 1.7, 1.7] }
                    }
                })
            );
            AsyncSink.setFile(
                "resourcepacks/AsyncSinkLib/assets/minecraft/textures/items/pissbucket.png",
                await (await fetch(pissBucketTexture)).arrayBuffer()
            );
            AsyncSink.setFile(
                "resourcepacks/AsyncSinkLib/assets/minecraft/models/item/cheeseburger.json",
                JSON.stringify({
                    parent: "builtin/generated",
                    textures: { layer0: "items/cheeseburger" },
                    display: {
                        thirdperson: {
                            rotation: [-90, 0, 0],
                            translation: [0, 1, -3],
                            scale: [0.55, 0.55, 0.55]
                        },
                        firstperson: {
                            rotation: [0, -135, 25],
                            translation: [0, 4, 2],
                            scale: [1.7, 1.7, 1.7]
                        }
                    }
                })
            );
            AsyncSink.setFile(
                "resourcepacks/AsyncSinkLib/assets/minecraft/textures/items/cheeseburger.png",
                await (await fetch(cheeseburgerTexture)).arrayBuffer()
            );

        });// end of lib:async
    })();
})();
